import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './admin.css'

function ViewJobSeekers() 
{
  const [jobseekers, setJobSeekers] = useState([]);

  const fetchjobseekers = async () => {
    try 
    {
      const response = await axios.get('http://localhost:2032/viewjobseekers');
      setJobSeekers(response.data);
    } 
    catch (error) 
    {
      console.error(error.message);
    }
  }

  useEffect(() => {
    fetchjobseekers();
  }, []);

  return (
    <div style={{ textAlign: 'center' }}>
      <h1>Job Seekers</h1>
      <table border={1} align="center" width="50%" height="25%">
        <thead>
          <tr>
            <th>Full Name</th>
            <th>Gender</th>
            <th>Date of Birth</th>
            <th>Email</th>
            <th>Location</th>
            <th>Contact</th>
          </tr>
        </thead>
        <tbody>
          {jobseekers.map( (jobseeker,index) => (
            <tr key={index}>
              <td>{jobseeker.fullname}</td>
              <td>{jobseeker.gender}</td>
              <td>{jobseeker.dateofbirth}</td>
              <td>{jobseeker.email}</td>
              <td>{jobseeker.location}</td>
              <td>{jobseeker.contact}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default ViewJobSeekers;
